window.bookSummaryJSON = "<p>A curse to break. A witch to find. A quadrant to rule.</p> <p>After two years of being separated and held at the mercy of a usurper queen, Creed is in a position to reclaim his throne. Honor is recovered. Our mating quad is complete. Now, all we have to do is repair the damage to the Dornte quadrant and pull it all together.</p> <p>The citizens want safety, freedom, and the restoration of the royal family.</p> <p>We're determined to give them that and more.</p> <p>But even as things turn around for the four of us, strife in the lives of those we love keep us fighting for our happily ever after. Doesn't matter. We're a lock, and it'll be worth the fight in the end.</p> <p><i>Dark Crown</i> is book three in the second harem of the Guardians of the Fae Realms, steamy reverse harem paranormal romance series. Expect sexy polyamorous situations (mmmfm), rollicking action, ongoing storylines, and shifter lovers who find what they need from not only their queen, but each other as well. Med-burn, med angst, vivid sexual content, and language.</p>"; 
